import React from 'react';
import "antd/dist/antd.css"
import Head from "next/head"
function _app({Component}){

    return (
        <>
            <Head>
                <meta charset="utf-8" />
                <title>nodebird</title>
            </Head>
            <Component />
        </>
    )
}

export default _app;
